import React from 'react';
import './Home.css'; // Import your CSS file for styling

const Home = () => {
  return (
    <div className="home">
      <div className="laptop">
        <div className="screen">
          <div className="code">Hello, I am Sandra Gonzalez, a Full Stack Software Engineer.</div>
        </div>
      </div>
    </div>
  );
};

export default Home;
